function ExpenseItem() {
  return (
    <div>
      <div>April 20th 1969</div>
      <div>
        <h2>Cat Insurance</h2>
        <div>$420.69</div>
      </div>
      <div></div>
    </div>
  );
}

export default ExpenseItem;
